import React, {Component} from "react";
import { Row, Col } from "react-bootstrap";

function Film(props) {
        return (
        <Row>
            {console.log(this.props.data.Id)}
            <Col>{this.props.data.Id}</Col>
            <Col>{this.props.data.Title}</Col>
            <Col>{this.props.data.AvgGrade}</Col>
        </Row>
    )
}

export default Film;
